import React from "react";
import Icon from "@mdi/react";
import { mdiAmmunition } from "@mdi/js";

export default function GenIcon() {
  return (
    <Icon
      path={mdiAmmunition}
      title="User Profile"
      size={1}
      horizontal
      vertical
      color="orange"
    />
  );
}
